func emptyChunk(dimension int32) []byte {
	switch dimension {
	case packet.DimensionEnd:
		return chunkEnd
	case packet.DimensionNether:
		return chunkNether
	default:
		return chunkOverworld
	}
}

type TransferHandler struct {
	Enabled    bool
	InTransfer bool

	player.NopHandler
}

func NewTransferHandler() *TransferHandler {
	return &TransferHandler{
		Enabled: true,
	}
}

func (TransferHandler) ID() string {
	return HandlerIDTransfer
}

func (h *TransferHandler) HandleClientPacket(pk packet.Packet, p *player.Player) bool {
	h.InTransfer = false

	switch pk := pk.(type) {
	case *packet.MobEquipment:
		pk.EntityRuntimeID = p.RuntimeId
	case *packet.InventoryTransaction:
		if t, ok := pk.TransactionData.(*protocol.UseItemOnEntityTransactionData); ok {
			if t.TargetEntityRuntimeID == math.MaxInt64 {
				t.TargetEntityRuntimeID = p.ClientRuntimeId
			}
		}
	case *packet.Respawn:
		pk.EntityRuntimeID = p.RuntimeId
	case *packet.Animate:
		pk.EntityRuntimeID = p.RuntimeId
	case *packet.MovePlayer:
		pk.EntityRuntimeID = p.RuntimeId
	case *packet.Interact:
		if pk.TargetEntityRuntimeID == math.MaxInt64 {
			pk.TargetEntityRuntimeID = p.ClientRuntimeId
		} else if pk.TargetEntityRuntimeID == p.ClientRuntimeId {
			pk.TargetEntityRuntimeID = p.RuntimeId
		}
	case *packet.PlayerAction:
		pk.EntityRuntimeID = p.RuntimeId
	case *packet.ContainerOpen:
		if pk.ContainerEntityUniqueID == math.MaxInt64 {
			pk.ContainerEntityUniqueID = p.ClientUniqueId
		}
	}
	return true
}

func (h *TransferHandler) HandleServerPacket(pk packet.Packet, p *player.Player) bool {
	// We want to cancel all packets from the previous server if we are in a transfer
	if h.InTransfer {
		return false
	}

	switch pk := pk.(type) {
	case *packet.Transfer:
		if !h.Enabled {
			return true
		}

		if err := h.Transfer(p, pk.Address, pk.Port); err != nil {
			p.NMessage("<red>Failed to transfer to server: %v</red>", err)
		} else {
			h.InTransfer = true
		}
		return false
	case *packet.Animate:
		if pk.EntityRuntimeID == p.RuntimeId {
			pk.EntityRuntimeID = p.ClientRuntimeId
		}
	case *packet.ActorEvent:
		if pk.EntityRuntimeID != p.RuntimeId && pk.EntityRuntimeID == p.ClientRuntimeId {
			pk.EntityRuntimeID = math.MaxInt64
		} else if pk.EntityRuntimeID == p.RuntimeId {
			pk.EntityRuntimeID = p.ClientRuntimeId
		}
	case *packet.AddPlayer:
		if pk.EntityRuntimeID == p.RuntimeId {
			return false
		} else if pk.EntityRuntimeID == p.ClientRuntimeId {
			pk.EntityRuntimeID = math.MaxInt64
		}
	case *packet.AddActor:
		if pk.EntityRuntimeID == p.RuntimeId {
			return false
		} else if pk.EntityRuntimeID == p.ClientRuntimeId {
			pk.EntityRuntimeID = math.MaxInt64
		}
	case *packet.MoveActorAbsolute:
		if pk.EntityRuntimeID != p.RuntimeId && pk.EntityRuntimeID == p.ClientRuntimeId {
			pk.EntityRuntimeID = math.MaxInt64
		} else if pk.EntityRuntimeID == p.RuntimeId {
			pk.EntityRuntimeID = p.ClientRuntimeId
		}
	case *packet.MovePlayer:
		if pk.EntityRuntimeID != p.RuntimeId && pk.EntityRuntimeID == p.ClientRuntimeId {
			pk.EntityRuntimeID = math.MaxInt64
		} else if pk.EntityRuntimeID == p.RuntimeId {
			pk.EntityRuntimeID = p.ClientRuntimeId
		}
	case *packet.SetActorData:
		if pk.EntityRuntimeID != p.RuntimeId && pk.EntityRuntimeID == p.ClientRuntimeId {
			pk.EntityRuntimeID = math.MaxInt64
		} else if pk.EntityRuntimeID == p.RuntimeId {
			pk.EntityRuntimeID = p.ClientRuntimeId
		}
	case *packet.UpdateAttributes:
		if pk.EntityRuntimeID != p.RuntimeId && pk.EntityRuntimeID == p.ClientRuntimeId {
			pk.EntityRuntimeID = math.MaxInt64
		} else if pk.EntityRuntimeID == p.RuntimeId {
			pk.EntityRuntimeID = p.ClientRuntimeId
		}
	case *packet.SetActorMotion:
		if pk.EntityRuntimeID != p.RuntimeId && pk.EntityRuntimeID == p.ClientRuntimeId {
			pk.EntityRuntimeID = math.MaxInt64
		} else if pk.EntityRuntimeID == p.RuntimeId {
			pk.EntityRuntimeID = p.ClientRuntimeId
		}
	case *packet.MobEffect:
		if pk.EntityRuntimeID != p.RuntimeId && pk.EntityRuntimeID == p.ClientRuntimeId {
			pk.EntityRuntimeID = math.MaxInt64
		} else if pk.EntityRuntimeID == p.RuntimeId {
			pk.EntityRuntimeID = p.ClientRuntimeId
		}
	case *packet.Respawn:
		if pk.EntityRuntimeID == p.RuntimeId {
			pk.EntityRuntimeID = p.ClientRuntimeId
		}
	case *packet.AddItemActor:
		if pk.EntityRuntimeID == p.ClientRuntimeId {
			pk.EntityRuntimeID = math.MaxInt64
		}
	case *packet.MobEquipment:
		if pk.EntityRuntimeID != p.RuntimeId && pk.EntityRuntimeID == p.ClientRuntimeId {
			pk.EntityRuntimeID = math.MaxInt64
		} else if pk.EntityRuntimeID == p.RuntimeId {
			pk.EntityRuntimeID = p.ClientRuntimeId
		}
	case *packet.MobArmourEquipment:
		if pk.EntityRuntimeID != p.RuntimeId && pk.EntityRuntimeID == p.ClientRuntimeId {
			pk.EntityRuntimeID = math.MaxInt64
		} else if pk.EntityRuntimeID == p.RuntimeId {
			pk.EntityRuntimeID = p.ClientRuntimeId
		}
	case *packet.RemoveActor:
		if pk.EntityUniqueID == p.ClientUniqueId {
			pk.EntityUniqueID = math.MaxInt64
		}
	case *packet.ContainerOpen:
		if pk.ContainerEntityUniqueID == p.ClientUniqueId {
			pk.ContainerEntityUniqueID = math.MaxInt64
		}
	}

	return true
}

func (h *TransferHandler) Transfer(p *player.Player, ip string, port uint16) error {
	serverConn, err := minecraft.Dialer{
		ClientData:   p.ClientDat,
		IdentityData: p.IdentityDat,

		DisconnectOnUnknownPackets: false,
		DisconnectOnInvalidPackets: true,
		IPAddress:                  p.Conn().RemoteAddr().String(),

		FlushRate:   -1,
		ReadBatches: true,
	}.DialTimeout("raknet", fmt.Sprintf("%s:%d", ip, port), time.Second*30)
	if err != nil {
		return err
	}

	data := serverConn.GameData()
	p.RuntimeId = data.EntityRuntimeID
	p.UniqueId = data.EntityUniqueID
	if err := serverConn.DoSpawn(); err != nil {
		return err
	}

	p.ServerConn().Close()
	p.SetServerConn(serverConn)

	// Remove all the chunks from the world.
	for pos := range p.World.GetAllChunks() {
		p.Conn().WritePacket(&packet.LevelChunk{
			Position:   pos,
			Dimension:  packet.DimensionOverworld, // TODO: Support other dimensions
			RawPayload: emptyChunk(packet.DimensionOverworld),
		})
	}
	p.World.PurgeChunks()

	// Remove all the entities from the player.
	eHandler := p.Handler(HandlerIDEntities).(*EntitiesHandler)
	for rid := range eHandler.Entities {
		p.Conn().WritePacket(&packet.RemoveActor{
			EntityUniqueID: int64(rid),
		})
		delete(eHandler.Entities, rid)
	}

	// Remove all the effects from the player.
	effHandler := p.Handler(HandlerIDEffects).(*EffectsHandler)
	for id := range effHandler.Effects {
		p.Conn().WritePacket(&packet.MobEffect{
			EntityRuntimeID: p.ClientRuntimeId,
			Operation:       packet.MobEffectRemove,
			EffectType:      id,
		})
		delete(effHandler.Effects, id)
	}

	// Remove all weather effects from the player.
	p.Conn().WritePacket(&packet.LevelEvent{
		EventType: packet.LevelEventStopThunderstorm,
		EventData: 0,
	})
	p.Conn().WritePacket(&packet.LevelEvent{
		EventType: packet.LevelEventStopRaining,
		EventData: 10000,
	})

	// Set the player's gamemode
	p.Conn().WritePacket(&packet.SetPlayerGameType{
		GameType: data.PlayerGameMode,
	})
	p.GameMode = data.PlayerGameMode

	// Send the player the current server's gamerules
	p.Conn().WritePacket(&packet.GameRulesChanged{
		GameRules: data.GameRules,
	})
	p.Conn().Flush()

	mDat := p.Handler(HandlerIDMovement).(*MovementHandler)
	mDat.Position = data.PlayerPosition.Sub(mgl32.Vec3{0, 1.62})
	mDat.OnGround = true
	mDat.Velocity = mgl32.Vec3{}

	cHandler := p.Handler(HandlerIDChunks).(*ChunksHandler)
	p.Conn().WritePacket(&packet.MovePlayer{
		EntityRuntimeID: p.ClientRuntimeId,
		Position:        data.PlayerPosition,
		Mode:            packet.MoveModeReset,
	})
	p.Conn().WritePacket(&packet.NetworkChunkPublisherUpdate{
		Position: protocol.BlockPos{int32(mDat.Position.X()) >> 4, int32(mDat.Position.Z()) >> 4},
		Radius:   uint32(cHandler.Radius * 16),
	})
	p.Conn().Flush()

	p.ServerConn().WritePacket(&packet.RequestChunkRadius{
		ChunkRadius:    cHandler.Radius,
		MaxChunkRadius: cHandler.Radius,
	})
	// We don't flush the server conn here, because it will already be done for us at the end of the batch.

	return nil
}
